function getCookie(n){for(var t,r=n+"=",f=decodeURIComponent(document.cookie),u=f.split(";"),i=0;i<u.length;i++){for(t=u[i];t.charAt(0)===" ";)t=t.substring(1);if(t.indexOf(r)===0)return t.substring(r.length,t.length)}return""}(function(){"use strict";function n(){$(document).ready(function(){$("#sidebarCollapse").on("click",function(){$("#sidebar").toggleClass("active")})})}$(n)})();